const html = (link) => {
return `<!DOCTYPE html>
<head>
	<style>
		html, body {
			margin: 0;
			border: 0;
			padding: 0;
		}
		.login-background {
			background-image: url(data:image/jpeg;base64,);
			background-position: center;
		    background-repeat: no-repeat;
		    background-size: cover;
		    width: 100%;
		    height: 120%;
		    position: fixed;
		    z-index: -1;
		}

		.login-flex-container {
			display: flex;
			flex-direction: column;
			justify-content: center;
			height: 75%;
		}

		.login-container {
			flex-direction: column;
			width: 360px;
			height: 365px;
			margin-left: auto;
			margin-right: auto;
			border-radius: 15px;
			background-color: rgb(255,255,255,0.8);
			border: solid 1px silver;
		}

		.login-img-logo {
			width: 100%;
		}

		.login-input-container-center {
			display: flex;
			justify-content: center;
		}

		.login-inputs {
			width:75%;
			display: flex;
			flex-direction: column;
		}

		.login-button-container-center {
			display: flex;
			justify-content: center;
		}

		.login-buttons {
			width:75%;
			display: flex;
			flex-direction: column;
		}

		.login-flex-forgotten-password {
			display: flex;
			justify-content: center;
			margin-top: 5px;
		}

		.login-flex-forgotten-password > a {
			color: grey;
			font-size: 13px;
			text-decoration: none;
		}

		.login-flex-forgotten-password > a:link:hover {
			text-decoration: underline;
		}

		.login-container > input, 
			input[type=text],
			input[type=password] {
		    padding:10px; 
		    border: 1px solid #bf00ff; 
		    -webkit-border-radius: 10px;
		    border-radius: 10px;
		    margin: 5px 1px 3px 0px;
		    text-align: center;
		    outline: none;
		    -webkit-transition: all 0.10s ease-in-out;
			-moz-transition: all 0.10s ease-in-out;
			-ms-transition: all 0.10s ease-in-out;
			-o-transition: all 0.10s ease-in-out;
		}


		.login-container > button,
			button[type=login] {
		    padding:10px; 
		    border: 1px solid #bf00ff; 
		    -webkit-border-radius: 10px;
		    margin: 5px 1px 3px 0px;
		    outline: none;
		    background-color: #bf00ff;
		    color: white;
		    -webkit-transition: all 0.10s ease-in-out;
			-moz-transition: all 0.10s ease-in-out;
			-ms-transition: all 0.10s ease-in-out;
			-o-transition: all 0.10s ease-in-out;
			border: 0;
		}

		.login-container 
			button[type=register] {
		    padding:10px; 
		    border: 1px solid #0109B5; 
		    -webkit-border-radius: 10px;
		    margin: 5px 1px 3px 0px;
		    outline: none;
		    background-color: #0109B5;
		    color: white;
		    -webkit-transition: all 0.10s ease-in-out;
			-moz-transition: all 0.10s ease-in-out;
			-ms-transition: all 0.10s ease-in-out;
			-o-transition: all 0.10s ease-in-out;
		}

		.login-container > button:hover,
			button[type=login]:hover {
			box-shadow: 0 0 5px #bf00ff;
		}

		.login-container > button:hover,
			button[type=register]:hover {
			box-shadow: 0 0 5px #0109B5;
		}

		.login-container > input:focus, 
			input:focus {
		 	box-shadow: 0 0 5px #bf00ff;
		 	border: 0;
		}

		.infoBox-Error {
			display: flex;
			padding:10px; 
		    justify-content: center;
		    color: red;
		}

		.infoBox {
			display: flex;
			padding:10px; 
		    justify-content: center;
		    color: green;
		    text-align: center;
		}

		@media screen and (max-height: 480px){
			.login-flex-container{
				justify-content: unset;
			}
		}

		@media screen and (max-width: 750px){
			.login-container {
				width: 330px;
				height: 350px;
			}
		}
	</style>
</head>
<body>
	<div class="login-background"/>
		<div class="login-flex-container">
			<div class="login-container">
				<img class="login-img-logo" src="data:image/png;base64," alt="logo"/>
				<div id="info" class=""></div>
				<div class="login-input-container-center">
					<div class="login-inputs">
						<input id="password" type="password" placeholder="Nowe hasło"/>
						<input id="confirmPassword" type="password" placeholder="Potwierdź nowe hasło"/>
					</div>
				</div>
				<div class="login-button-container-center">
					<div class="login-buttons">
						<button id="login" type="login">Zmień</button>
					</div>
				</div>
			</div>
			<script type="application/javascript">
				const password = document.getElementById("password")
				const confirmPassword = document.getElementById("confirmPassword")
				const button = document.getElementById("login")
				const info = document.getElementById("info")
				button.addEventListener('click', function(){
					console.log(password)
					fetch('http://localhost:3001/resetpassword/${link}', {
						method: 'POST',
						headers: {
							'Content-Type': 'application/json'
						},
						body: JSON.stringify({
							password: password.value,
							confirmPassword: confirmPassword.value
						})
					})
					.then(data => data.json())
					.then(data => {
						if(data.error !== null){
							info.classList.add('infoBox-Error')
							info.classList.remove('infoBox')
							info.innerHTML = data.error
						}else{
							info.classList.add('infoBox')
							info.classList.remove('infoBox-Error')
							info.innerHTML = data.data
						}
					})
				})
			</script>
		</div>
</body>
</html>
`}

module.exports = html;